// import '../App.scss';
import { Routes, Route } from 'react-router-dom';
import Home from './Home';
// import About from './About';
// import Contact from './Contact';

function App() {
  return (
    <div className="App">
      <h1>Hello React Router v6</h1>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
